import React from 'react';


const style_block = {
  display: 'block',
}


const Inputs_left = () => {

  return (<div style={style_block}>
    <label for="First_Name">Імʼя</label>
    <input name="first_name" id="First_Name" type="text" ></input>
    <label for="Last_Name">Фамілія:</label>
    <input name="last_name" id="Last_Name" type="text" ></input>
    <div>
      <label for="Company">Last Name:</label>
      <input name="company" id="Company" type="text" ></input>
    </div>
    <label for="Name">Last Name:</label>
    <input name="last_name" id="Last_Name" type="text" ></input>
    <div>

      <label for="Name">Last Name:</label>
      <input name="last_name" id="Last_Name" type="text" ></input>
    </div>
  </div>
  );

}

export default Inputs_left;
